import style from './Cart.module.css'
import Model from '../UI/Model'

const Cart = () => {
  const CartItems = (
    <ul>
      {[{ id: "1", name: "A2B", price: 25 }].map((meal) => (
        <li>{meal}</li>
      ))}
    </ul>
  );

  return (
    <Model className={style['cart-items']}>
       {CartItems} 
      <div className={style.total}>
          <span>Total</span>
          <span>50</span>
      </div>
      <div className={style.actions}>
          <button>Close</button>
          <button>Order</button>
      </div>
    </Model>
  );
};

export default Cart;
